-- PART 1: DATA DEFINITION LANGUAGE (DDL) - CREATE TABLES
-- ============================================================================

-- Drop existing tables in reverse dependency order
DROP TABLE IF EXISTS Surveys CASCADE;
DROP TABLE IF EXISTS Registrations CASCADE;
DROP TABLE IF EXISTS Donations CASCADE;
DROP TABLE IF EXISTS Milestones CASCADE;
DROP TABLE IF EXISTS EventOccurrences CASCADE;
DROP TABLE IF EXISTS EventTemplates CASCADE;
DROP TABLE IF EXISTS Participants CASCADE;
DROP TABLE IF EXISTS Users CASCADE;
DROP TABLE IF EXISTS donoruser CASCADE;

-- ============================================================================
-- TABLE: Users
-- ============================================================================
-- Application user accounts for authentication and authorization
-- Primary Key: UserID (surrogate key, auto-increment)
-- Natural Key: UserEmail (UNIQUE)
-- ============================================================================

CREATE TABLE Users (
    UserID SERIAL PRIMARY KEY,
    UserEmail VARCHAR(255) NOT NULL UNIQUE,
    UserFirstName VARCHAR(100) NOT NULL,
    UserLastName VARCHAR(100) NOT NULL,
    Password VARCHAR(255) NOT NULL,
    UserRole VARCHAR(20) NOT NULL,

    -- Constraints
    CONSTRAINT chk_user_email_format CHECK (UserEmail ~* '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$'),
    CONSTRAINT chk_user_role CHECK (UserRole IN ('manager', 'common'))
);

CREATE TABLE userdonor (
    donoruserid SERIAL PRIMARY KEY,
    donoruserfirstname VARCHAR(255) NOT NULL UNIQUE,
    userdonorlastname VARCHAR(100) NOT NULL,
    userdonoramount INTEGER NOT NULL,
    userdonordate DATE NOT NULL
);

-- Comments
COMMENT ON TABLE Users IS 'Application user accounts for authentication';
COMMENT ON COLUMN Users.UserID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Users.UserEmail IS 'Unique email address used for login';
COMMENT ON COLUMN Users.Password IS 'User password (should be hashed with bcrypt in production)';
COMMENT ON COLUMN Users.UserRole IS 'Access level: manager (full CRUD) or common (read-only)';

-- Indexes
CREATE INDEX idx_users_email ON Users(UserEmail);
CREATE INDEX idx_users_role ON Users(UserRole);

-- ============================================================================
-- TABLE: Participants
-- ============================================================================
-- Program participants with demographics and contact information
-- Primary Key: ParticipantID (surrogate key, auto-increment)
-- Natural Key: ParticipantEmail (UNIQUE)
-- NOTE: ParticipantRole column has been EXCLUDED per project requirements
-- ============================================================================

CREATE TABLE Participants (
    ParticipantID SERIAL PRIMARY KEY,
    ParticipantEmail VARCHAR(255) NOT NULL UNIQUE,
    ParticipantFirstName VARCHAR(100) NOT NULL,
    ParticipantLastName VARCHAR(100) NOT NULL,
    ParticipantDOB DATE,
    ParticipantPhone VARCHAR(20),
    ParticipantCity VARCHAR(100),
    ParticipantState VARCHAR(2),
    ParticipantZip VARCHAR(10),
    ParticipantSchoolOrEmployer VARCHAR(255),
    ParticipantFieldOfInterest VARCHAR(50),
    TotalDonations DECIMAL(10, 2) DEFAULT 0.00,

    -- Constraints
    CONSTRAINT chk_participant_email_format CHECK (ParticipantEmail ~* '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$'),
    CONSTRAINT chk_participant_state CHECK (ParticipantState ~* '^[A-Z]{2}$' OR ParticipantState IS NULL),
    CONSTRAINT chk_participant_total_donations CHECK (TotalDonations >= 0)
);

-- Comments
COMMENT ON TABLE Participants IS 'Program participants with demographics and contact information';
COMMENT ON COLUMN Participants.ParticipantID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Participants.ParticipantEmail IS 'Unique email address - natural key';
COMMENT ON COLUMN Participants.TotalDonations IS 'Cumulative donation amount from this participant';

-- Indexes
CREATE INDEX idx_participants_email ON Participants(ParticipantEmail);
CREATE INDEX idx_participants_name ON Participants(ParticipantLastName, ParticipantFirstName);
CREATE INDEX idx_participants_city ON Participants(ParticipantCity);
CREATE INDEX idx_participants_state ON Participants(ParticipantState);

-- ============================================================================
-- TABLE: EventTemplates
-- ============================================================================
-- Event type templates (general event definitions)
-- Primary Key: EventTemplateID (surrogate key, auto-increment)
-- Natural Key: EventName (UNIQUE)
-- ============================================================================

CREATE TABLE EventTemplates (
    EventTemplateID SERIAL PRIMARY KEY,
    EventName VARCHAR(255) NOT NULL UNIQUE,
    EventType VARCHAR(50) NOT NULL,
    EventDescription TEXT,
    EventRecurrencePattern VARCHAR(50),
    EventDefaultCapacity INTEGER,

    -- Constraints
    CONSTRAINT chk_event_type CHECK (EventType IN ('STEM', 'Leadership', 'Empowerment', 'Arts', 'Health', 'Career', 'Annual Conference')),
    CONSTRAINT chk_event_default_capacity CHECK (EventDefaultCapacity > 0 OR EventDefaultCapacity IS NULL)
);

-- Comments
COMMENT ON TABLE EventTemplates IS 'Event type templates with general event properties';
COMMENT ON COLUMN EventTemplates.EventTemplateID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN EventTemplates.EventName IS 'Unique event name - natural key';
COMMENT ON COLUMN EventTemplates.EventType IS 'Category: STEM, Leadership, Empowerment, Arts, Health, Career, or Annual Conference';
COMMENT ON COLUMN EventTemplates.EventRecurrencePattern IS 'How often the event occurs (e.g., Weekly, Monthly)';

-- Indexes
CREATE INDEX idx_event_templates_name ON EventTemplates(EventName);
CREATE INDEX idx_event_templates_type ON EventTemplates(EventType);

-- ============================================================================
-- TABLE: EventOccurrences
-- ============================================================================
-- Specific scheduled instances of event templates
-- Primary Key: EventOccurrenceID (surrogate key, auto-increment)
-- Natural Key: (EventName, EventDate, EventTimeStart) (UNIQUE)
-- Foreign Key: EventTemplateID references EventTemplates
-- ============================================================================

CREATE TABLE EventOccurrences (
    EventOccurrenceID SERIAL PRIMARY KEY,
    EventTemplateID INTEGER NOT NULL,
    EventName VARCHAR(255) NOT NULL,
    EventDate DATE NOT NULL,
    EventTimeStart TIME NOT NULL,
    EventTimeEnd TIME,
    EventLocation VARCHAR(255),
    EventCapacity INTEGER,
    EventRegistrationDeadline DATE,

    -- Foreign Keys
    CONSTRAINT fk_event_occurrence_template 
        FOREIGN KEY (EventTemplateID) 
        REFERENCES EventTemplates(EventTemplateID)
        ON DELETE RESTRICT
        ON UPDATE CASCADE,

    -- Constraints
    CONSTRAINT chk_event_capacity CHECK (EventCapacity > 0 OR EventCapacity IS NULL),
    CONSTRAINT chk_event_time CHECK (EventTimeEnd > EventTimeStart OR EventTimeEnd IS NULL),
    CONSTRAINT uq_event_occurrence UNIQUE (EventName, EventDate, EventTimeStart)
);

-- Comments
COMMENT ON TABLE EventOccurrences IS 'Specific scheduled instances of event templates';
COMMENT ON COLUMN EventOccurrences.EventOccurrenceID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN EventOccurrences.EventTemplateID IS 'Foreign key to EventTemplates';
COMMENT ON COLUMN EventOccurrences.EventName IS 'Denormalized for natural key uniqueness';

-- Indexes
CREATE INDEX idx_event_occurrences_template ON EventOccurrences(EventTemplateID);
CREATE INDEX idx_event_occurrences_name ON EventOccurrences(EventName);
CREATE INDEX idx_event_occurrences_date ON EventOccurrences(EventDate);
CREATE INDEX idx_event_occurrences_location ON EventOccurrences(EventLocation);

-- ============================================================================
-- TABLE: Registrations
-- ============================================================================
-- Participant registrations for event occurrences
-- Primary Key: RegistrationID (surrogate key, auto-increment)
-- Natural Key: (ParticipantEmail, EventName, EventDate, EventTimeStart) (UNIQUE)
-- Foreign Keys: ParticipantID, EventOccurrenceID
-- NOTE: RegistrationAttendedFlag column has been EXCLUDED per project requirements
-- ============================================================================

CREATE TABLE Registrations (
    RegistrationID SERIAL PRIMARY KEY,
    ParticipantID INTEGER NOT NULL,
    EventOccurrenceID INTEGER NOT NULL,
    ParticipantEmail VARCHAR(255) NOT NULL,
    EventName VARCHAR(255) NOT NULL,
    EventDate DATE NOT NULL,
    EventTimeStart TIME NOT NULL,
    RegistrationStatus VARCHAR(20),
    RegistrationCheckInDate DATE,
    RegistrationCheckInTime TIME,
    RegistrationCreatedDate DATE,

    -- Foreign Keys
    CONSTRAINT fk_registration_participant 
        FOREIGN KEY (ParticipantID) 
        REFERENCES Participants(ParticipantID)
        ON DELETE RESTRICT
        ON UPDATE CASCADE,

    CONSTRAINT fk_registration_event_occurrence 
        FOREIGN KEY (EventOccurrenceID) 
        REFERENCES EventOccurrences(EventOccurrenceID)
        ON DELETE RESTRICT
        ON UPDATE CASCADE,

    -- Constraints
    CONSTRAINT chk_registration_status CHECK (RegistrationStatus IN ('registered', 'attended', 'cancelled', 'no-show') OR RegistrationStatus IS NULL),
    CONSTRAINT uq_registration UNIQUE (ParticipantEmail, EventName, EventDate, EventTimeStart)
);

-- Comments
COMMENT ON TABLE Registrations IS 'Participant registrations for event occurrences';
COMMENT ON COLUMN Registrations.RegistrationID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Registrations.RegistrationStatus IS 'Status: registered, attended, cancelled, or no-show';
COMMENT ON COLUMN Registrations.RegistrationCheckInDate IS 'Date participant checked in (if attended)';

-- Indexes
CREATE INDEX idx_registrations_participant ON Registrations(ParticipantID);
CREATE INDEX idx_registrations_event_occurrence ON Registrations(EventOccurrenceID);
CREATE INDEX idx_registrations_status ON Registrations(RegistrationStatus);
CREATE INDEX idx_registrations_created_date ON Registrations(RegistrationCreatedDate);

-- ============================================================================
-- TABLE: Surveys
-- ============================================================================
-- Post-event survey responses
-- Primary Key: SurveyID (surrogate key, auto-increment)
-- Foreign Key: RegistrationID references Registrations (1:1 relationship)
-- ============================================================================

CREATE TABLE Surveys (
    SurveyID SERIAL PRIMARY KEY,
    RegistrationID INTEGER NOT NULL UNIQUE,
    ParticipantEmail VARCHAR(255) NOT NULL,
    EventName VARCHAR(255) NOT NULL,
    EventDate DATE NOT NULL,
    EventTimeStart TIME NOT NULL,
    SurveySatisfactionScore INTEGER,
    SurveyUsefulnessScore INTEGER,
    SurveyInstructorScore INTEGER,
    SurveyRecommendationScore INTEGER,
    SurveyOverallScore DECIMAL(3, 2),
    SurveyNPSBucket VARCHAR(20),
    SurveyComments TEXT,
    SurveySubmissionDate DATE,
    SurveySubmissionTime TIME,

    -- Foreign Keys
    CONSTRAINT fk_survey_registration 
        FOREIGN KEY (RegistrationID) 
        REFERENCES Registrations(RegistrationID)
        ON DELETE CASCADE
        ON UPDATE CASCADE,

    -- Constraints
    CONSTRAINT chk_survey_satisfaction CHECK (SurveySatisfactionScore BETWEEN 1 AND 5 OR SurveySatisfactionScore IS NULL),
    CONSTRAINT chk_survey_usefulness CHECK (SurveyUsefulnessScore BETWEEN 1 AND 5 OR SurveyUsefulnessScore IS NULL),
    CONSTRAINT chk_survey_instructor CHECK (SurveyInstructorScore BETWEEN 1 AND 5 OR SurveyInstructorScore IS NULL),
    CONSTRAINT chk_survey_recommendation CHECK (SurveyRecommendationScore BETWEEN 1 AND 10 OR SurveyRecommendationScore IS NULL),
    CONSTRAINT chk_survey_overall CHECK (SurveyOverallScore BETWEEN 1.00 AND 5.00 OR SurveyOverallScore IS NULL),
    CONSTRAINT chk_survey_nps_bucket CHECK (SurveyNPSBucket IN ('Detractor', 'Passive', 'Promoter') OR SurveyNPSBucket IS NULL)
);

-- Comments
COMMENT ON TABLE Surveys IS 'Post-event survey responses from participants';
COMMENT ON COLUMN Surveys.SurveyID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Surveys.RegistrationID IS 'Foreign key to Registrations (1:1 relationship)';
COMMENT ON COLUMN Surveys.SurveyNPSBucket IS 'Net Promoter Score category: Detractor (1-6), Passive (7-8), Promoter (9-10)';

-- Indexes
CREATE INDEX idx_surveys_registration ON Surveys(RegistrationID);
CREATE INDEX idx_surveys_nps_bucket ON Surveys(SurveyNPSBucket);
CREATE INDEX idx_surveys_submission_date ON Surveys(SurveySubmissionDate);

-- ============================================================================
-- TABLE: Milestones
-- ============================================================================
-- Participant achievement milestones
-- Primary Key: MilestoneID (surrogate key, auto-increment)
-- Natural Key: (ParticipantEmail, MilestoneTitle, MilestoneDate) (UNIQUE)
-- Foreign Key: ParticipantID references Participants
-- ============================================================================

CREATE TABLE Milestones (
    MilestoneID SERIAL PRIMARY KEY,
    ParticipantID INTEGER NOT NULL,
    ParticipantEmail VARCHAR(255) NOT NULL,
    MilestoneTitle VARCHAR(255) NOT NULL,
    MilestoneDate DATE NOT NULL,

    -- Foreign Keys
    CONSTRAINT fk_milestone_participant 
        FOREIGN KEY (ParticipantID) 
        REFERENCES Participants(ParticipantID)
        ON DELETE CASCADE
        ON UPDATE CASCADE,

    -- Constraints
    CONSTRAINT uq_milestone UNIQUE (ParticipantEmail, MilestoneTitle, MilestoneDate)
);

-- Comments
COMMENT ON TABLE Milestones IS 'Participant achievement milestones';
COMMENT ON COLUMN Milestones.MilestoneID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Milestones.MilestoneTitle IS 'Type of milestone (e.g., High School Diploma, Published Project)';

-- Indexes
CREATE INDEX idx_milestones_participant ON Milestones(ParticipantID);
CREATE INDEX idx_milestones_date ON Milestones(MilestoneDate);
CREATE INDEX idx_milestones_title ON Milestones(MilestoneTitle);

-- ============================================================================
-- TABLE: Donations
-- ============================================================================
-- Individual donation records from participants
-- Primary Key: DonationID (surrogate key, auto-increment)
-- Natural Key: (ParticipantEmail, DonationDate, DonationAmount) (UNIQUE)
-- Foreign Key: ParticipantID references Participants
-- ============================================================================

CREATE TABLE Donations (
    DonationID SERIAL PRIMARY KEY,
    ParticipantID INTEGER NOT NULL,
    ParticipantEmail VARCHAR(255) NOT NULL,
    DonationDate DATE,
    DonationAmount DECIMAL(10, 2) NOT NULL,

    -- Foreign Keys
    CONSTRAINT fk_donation_participant 
        FOREIGN KEY (ParticipantID) 
        REFERENCES Participants(ParticipantID)
        ON DELETE CASCADE
        ON UPDATE CASCADE,

    -- Constraints
    CONSTRAINT chk_donation_amount CHECK (DonationAmount > 0),
    CONSTRAINT uq_donation UNIQUE (ParticipantEmail, DonationDate, DonationAmount)
);

-- Comments
COMMENT ON TABLE Donations IS 'Individual donation records from participants';
COMMENT ON COLUMN Donations.DonationID IS 'Auto-incrementing surrogate primary key';
COMMENT ON COLUMN Donations.DonationAmount IS 'Donation amount in USD';

-- Indexes
CREATE INDEX idx_donations_participant ON Donations(ParticipantID);
CREATE INDEX idx_donations_date ON Donations(DonationDate);
CREATE INDEX idx_donations_amount ON Donations(DonationAmount);


