-- Display record counts for all tables
SELECT
    table_name,
    record_count,
    expected
FROM (
    SELECT
        'Users' AS table_name,
        COUNT(*) AS record_count,
        '5 expected' AS expected
    FROM Users
    UNION ALL
    SELECT
        'Participants',
        COUNT(*),
        '1,176 expected'
    FROM Participants
    UNION ALL
    SELECT
        'EventTemplates',
        COUNT(*),
        '15 expected'
    FROM EventTemplates
    UNION ALL
    SELECT
        'EventOccurrences',
        COUNT(*),
        '1,405 expected'
    FROM EventOccurrences
    UNION ALL
    SELECT
        'Registrations',
        COUNT(*),
        '1,860 expected'
    FROM Registrations
    UNION ALL
    SELECT
        'Surveys',
        COUNT(*),
        '1,400 expected'
    FROM Surveys
    UNION ALL
    SELECT
        'Milestones',
        COUNT(*),
        '1,480 expected'
    FROM Milestones
    UNION ALL
    SELECT
        'Donations',
        COUNT(*),
        '767 expected'
    FROM Donations
    UNION ALL
    SELECT
        'TOTAL',
        (SELECT COUNT(*) FROM Users) +
        (SELECT COUNT(*) FROM Participants) +
        (SELECT COUNT(*) FROM EventTemplates) +
        (SELECT COUNT(*) FROM EventOccurrences) +
        (SELECT COUNT(*) FROM Registrations) +
        (SELECT COUNT(*) FROM Surveys) +
        (SELECT COUNT(*) FROM Milestones) +
        (SELECT COUNT(*) FROM Donations),
        '8,108 expected'
) AS counts
ORDER BY
    CASE table_name
        WHEN 'Users' THEN 1
        WHEN 'Participants' THEN 2
        WHEN 'EventTemplates' THEN 3
        WHEN 'EventOccurrences' THEN 4
        WHEN 'Registrations' THEN 5
        WHEN 'Surveys' THEN 6
        WHEN 'Milestones' THEN 7
        WHEN 'Donations' THEN 8
        WHEN 'TOTAL' THEN 9
    END;

-- Verify foreign key relationships (should all return 0)
SELECT 
    'Invalid EventOccurrences->EventTemplates' AS test,
    COUNT(*) AS invalid_count
FROM EventOccurrences eo
LEFT JOIN EventTemplates et ON eo.EventTemplateID = et.EventTemplateID
WHERE et.EventTemplateID IS NULL

UNION ALL

